script: |
  super -f text -I q6058.spq | sort > q6058.out

inputs:
  - name: q6058.spq
    data: |
      SELECT DISTINCT + col0 / - - col0 AS col0 FROM tab0 (FORMAT parquet) WHERE NOT 30 * + + col0 + + + CAST ( 61 AS REAL ) + - col2 * + - col2 > + col2;
  - name: tab0

outputs:
  - name: q6058.out
    data: |
